func TestLoadStock(t *testing.T) {
	re := regexp.MustCompile(`（(\d+)）([^|]+) \|`)

	// ALl Match String
	matches := re.FindAllStringSubmatch(text, -1)

	// Database Connection
	db := GetDB()
	tx, err := db.Begin()
	if err != nil {
		t.Fatalf("db.Begin() Failure :: %s", err.Error())
	}

	// Query ST_FUND
	res, err := asql.Select(tx, "SELECT code, name FROM ST_FUND")
	funds := base.ResAsMap(res, false, "code", "name")

	for i, match := range matches {
		code, name := match[1], match[2]
		_, ok := funds[code]
		if !ok {
			// Insert ST_FUND
			args := []interface{}{asql.GenerateId(), code, name, asql.GenerateOrderId(), asql.GetNow()}
			_, err := tx.Exec("INSERT INTO ST_FUND(id, code, name, order_, create_at_) VALUES (?, ?, ?, ?, ?)", args...)
			if err != nil {
				t.Fatalf("db.Exec() Failure :: %s", err.Error())
			}
		}

		// Output Progress
		if i%200 == 0 {
			t.Logf("正在更新中 (%d/%d %5.2f%%) ...", i, len(matches), float64(i+1)*100/float64(len(matches)))
		}
	}

	if err := tx.Commit(); err != nil {
		t.Fatalf("tx.Commit() Failure :: %s", err.Error())
	}
	logrus.Info("更新完成 ...")
}

